import React,{Component} from 'react';
import './Signin.css'

 
export default class Admin extends Component {
  render() {
    return (
      
      <div id="wrapper">
        <form id="login">
        <h2>Accounts Management</h2>

        <div id="container" class="col-md-9">
          <br></br>
          <br></br>
           <div>
            {this.state.display}
          </div>
          <br></br>

        </div>
        </form>
      </div>
    );
  }
}
